import React, { Component } from "react";
import ListPosts from "../Container/ListPosts";
import SignIn from "../auth/SignIn";
class Dashboard extends Component {
  render() {
    return (
      <div>
        <div className="row">
          <div className="col s12 m6">
            <ListPosts />
          </div>

          <div>
            <SignIn />
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
